SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION1, "|cffffff地区剧情任务|r是该地区的故事主线。完成这些任务之后，你可以获得技能点数、经验、金币和装备。", 2)
SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION10, "|cffffff标志性地点|r是世界中的标志性地点。在你探索地区内的所有标志性地点后，将获得该地区的“探路者”成就。", 2)
SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION11, "|cffffff沙里多尔的图书馆书籍|r散布在世界各地。它们以其独特的紫色光芒而闻名，发现这些书籍能提升你的法师公会等级以及相关的技能等级。", 2)
SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION12, "|cffffff梦达思之石|r是世界中以临时增益的方式给予玩家恩赐的物体。该效果会持续到被另一个不同的梦达思之石恩赐所取代。", 2)
SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION13, "|cffffff公共地下城|r是遍布泰姆瑞尔与其他地点的开放世界地下城，它们可供四名玩家组队探险。完成公共地下城的不同部分可奖励你技能点数、经验、金币与装备。", 3)
SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION14, "|cffffff套装铸造点|r分布在世界中的不同地点，你可以在其中制作拥有特殊套装加成的物品。", 2)
SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION2, "|cffffff兴趣点|r可供你在独立剧情中探索地区内的传说、人物和地点，并奖励经验、金币和装备。", 3)
SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION4, "|cffffff路点神龛|r允许你在已发现并解锁的路点神龛之间即时免费移动。你也可以花费少量金币，从世界中的任何地方直接前往任何已解锁的路点神龛。", 3)
SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION5, "|cffffff洞穴|r是分布在世界各处，可供单人攻略的地下城。洞穴中始终包括一块天空裂片，以及一名会掉落物品套装部件的BOSS。", 2)
SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION6, "|cffffff组队洞穴|r是位于荒崖的公共地下城，专供四名玩家组队挑战。组队洞穴中始终包括一块天空裂片，以及一名会掉落物品套装部件的BOSS。", 2)
SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION7, "|cffffff天空裂片|r分散在世界各地，可以通过它们发出的明亮白色光线来识别。发现三块天空裂片后可获得一个技能点，能够用来解锁或变形新的技能。", 2)
SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION8, "|cffffff世界事件|r是世界上发生的活动（例如“暗锚”等），集结一群冒险者来处理是上佳之策。完成世界事件后，你可以获得经验、金币和更高等级的装备。", 2)
SafeAddString(SI_ZONECOMPLETIONTYPE_DESCRIPTION9, "|cffffff世界BOSS|r是极其强大的敌人，集结一群冒险者来处理是上佳之策。击败世界BOSS可获得更高等级的装备。", 2)
